import React from 'react';
import Logo from '../logoHenry.png'
import SearchBar from './SearchBar.jsx';
import './Nav.css';

function Nav({onSearch}) {
  return (

    <nav className=''>
    <img id='logoHenry'src={Logo} alt='img'/>
    <span>Henry - Weather App </span>
    <SearchBar className='srch' onSearch={this.props.onSearch}/>

  </nav>
  );
};

export default Nav;
